input = ""


def solve(input, offset, phases):
    elements = [int(num) for _ in range(phases) for num in input][offset:]

    for _ in range(100):
        for i in range(-2, -len(elements) - 1, -1):
            elements[i] = (elements[i] + elements[i + 1]) % 10

    print("".join([str(x) for x in elements[:8]]))


solve(input, 0, 1)
solve(input, int(input[:7]), 10000)
